let day = prompt("Введите время суток (Утро, Полдень, Обед, Вечер, Ночь):");

let new_day =  day.toLowerCase(); // -> lower
switch (new_day) {
    case "утро":
        document.write('<img src="image/img.png">')
        alert(`BOSS, добрый утро`);
        break;
    case "полдень":
        document.write('<img  src="https://cdn.fishki.net/upload/post/201511/10/1730874/5faf2cabecca467dcd82abafa2c077e9.jpg" alt="">')
        alert(`BOSS, Хорошего дня!`);
        break;
    case "обед":
        document.write('<img src="data:image/jpeg;base64," alt="">')
        alert(`BOSS, Хорошего день!`);
        break;
    case "вечер":
        document.write('<img src="data:image/jpeg;base64," alt="">')
        alert(`BOSS, Добрый вечер!`);
        break;
    case "ночь":
        document.write('<img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRfNtEFofl2XQbtDpX7u_npkP52QEY3uaZ0Ug&s" alt="">')
        alert(`BOSS, Спокойной ночи!`);
        break;
    default:
        document.write('<img src="data:image/png;base64," alt="">')
        console.log("Некорректный ввод.");
}